    true,nt"url": null,nt"notes": "The scope of this project is to to develop
    a wide bandwidth, low power, and compact single board digital Fast Fourier Transformrnspectrometer
    (FFTS) optimized for the signal processing requirements of next generation instruments
    and receivers on-board both earth observing and planetary exploration missions.
    We achieve our design objectives of wide bandwidth and real-time streaming performance
    in a compact and low power form factor by utilizing cutting edge ADC &amp; FPGA
    hardware solutions in combination with high performance FFT IP cores. ",nt"license_title":
